using System.Windows.Data;
using System.Collections.Generic;
using System.Collections.ObjectModel;
using System;
using System.Windows.Media.Imaging;
using System.Windows;
using System.IO;
using Xceed.Wpf.Toolkit.PropertyGrid;

namespace PSM.Viewer.Visualizations
{

    [Visible(true)]
    [DisplayName("Image")]
    [Icon("../icons/image.png")]
    [SubCategory("Built-In")]
    public sealed partial class Image : VisualizationControl
    {

        public BitmapSource Bitmap
        {
            get
            {
                byte[] bytes = Convert.FromBase64String(Data);
                Stream stream = new MemoryStream(bytes);

                BitmapDecoder decoder = PngBitmapDecoder.Create(stream, BitmapCreateOptions.PreservePixelFormat, BitmapCacheOption.Default);

                return decoder.Frames[0];
            }
        }

        private string _data = @"";
        public string Data
        {
            get
            {

                if (_uri != null && File.Exists(_uri.AbsolutePath))
                {

                    using (FileStream stream = File.OpenRead(Uri.AbsolutePath))
                    {

                        byte[] bytes = new byte[stream.Length];

                        stream.Read(bytes, 0, (int)stream.Length);

                        _data = Convert.ToBase64String(bytes);

                    }                    
                }

                return _data;
            }

            set
            {
                SetField<string>(ref _data, value, "Data");
                OnPropertyChanged("Bitmap");
            }
        }

        private Uri _uri = null;
        public Uri Uri
        {
            get
            {
                return _uri;
            }

            set
            {

                if (value != null && File.Exists(value.AbsolutePath))
                {
                    SetField(ref _uri, value, "Uri");
                }
                
                {
                    OnPropertyChanged("Data");
                    OnPropertyChanged("Bitmap");
                }
            }
        }

        public override void Refresh()
        {
           
            base.Refresh();
        }

        public Image()

        {            
            InitializeComponent();

            Properties.Add(new PropertyDefinition()
            {
                Category = "Image",
                TargetProperties = new List<object>(new string[] { "Uri" })
            });

            _userCommands.Remove("Edit Keys");

        }
        
    }
}
